    return (z2 * static_cast<long long>(std::pow(10, 2 * half_size))) +
           ((z1 - z2 - z0) * static_cast<long long>(std::pow(10, half_size))) +
           z0;
}

int main(int argc, char *argv[]) {
    // Check if the correct number of arguments have been provided
    if (argc != 3) {
        std::cerr << "Usage: " << argv[0] << " <number1> <number2>" << std::endl;
        return 1;
    }

    // Convert input strings to integers
    long long num1 = std::atoll(argv[1]);
    long long num2 = std::atoll(argv[2]);

    // Perform multiplication using Karatsuba algorithm
    long long result = karatsuba(num1, num2);

    // Output the result to the command line
    std::cout << num1 << " * " << num2 << " = " << result << std::endl;

    return 0;
}
